import * as React from 'react';
import instalogo from "./assets/instagram-logo.png"
import { Route, Routes } from "react-router";
import { Link } from "react-router-dom";
import Divider from '@mui/material/Divider';
import ListItemButton from '@mui/material/ListItemButton';
import Home from '@mui/icons-material/Home';
import Search from '@mui/icons-material/Search';
import Explore from '@mui/icons-material/Explore';
import Reels from '@mui/icons-material/Slideshow';
import Messages from '@mui/icons-material/Chat';
import Notification from '@mui/icons-material/FavoriteBorder';
import CreatePost from '@mui/icons-material/AddCard';
import Menu from '@mui/icons-material/Menu';
import Homepage from '../pages/Home';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import boy from './assets/Avatars/boy.png';
import "./components.css"


function Leftbar() {

  return (
<div className='leftbar'>
  <img id="insta" src={instalogo} alt="instalogo" width={"100px"} />
  <Divider />
  <Divider orientation="vertical" flexItem />

  <Link id="but" to="/">
      <ListItemButton>
        <h2><Home fontSize='small'/> Home</h2>
      </ListItemButton>
      </Link>

      <Link id="but" to="/prog">
      <ListItemButton color='white'>
      <h2><Search fontSize='small'/> Search</h2>
      </ListItemButton>
      </Link>

      <ListItemButton>
        <h2> <Explore fontSize='small'/> Explore</h2>
      </ListItemButton>
      <ListItemButton>
        <h2 id="but"> <Reels fontSize='small'/> Reels</h2>
      </ListItemButton>

      <ListItemButton>
      <h2><Messages fontSize='small'/> Messages</h2>
      </ListItemButton>

      <ListItemButton>
        <h2> <Notification fontSize='small'/> Notification</h2>
      </ListItemButton>
      <ListItemButton>
        <h2> <CreatePost fontSize='small'/> CreatePost</h2>
      </ListItemButton>

      <ListItem>
          <Avatar src={boy}/>
        <ListItemText primary="Ezzkalash" secondary="ezzo" />
      </ListItem>
      <ListItemButton>
        <Divider></Divider>


        <h2 > <Menu fontSize='small'/> Menu</h2>
      </ListItemButton>

      <Divider orientation="vertical"  />

  <Divider />

</div>


  );
}



export default Leftbar;
